{
  "alleged-fool": {
    "name": "fool",
    "upright": "#alleged-fool-upright",
    "reversed": "#alleged-fool-reversed",
    "explain": "The Fool represents a lucky chancer—happy to take things as they come, and not afraid to trust to his fate. The Fool would rather smell the roses than worry too much about the wild animals that he wanders amongst or the cliff at his feet or the little dog who is trying to warn him to pay attention. But that’s OK, at least up to a point. When the Major Arcana are viewed as a journey from ignorance to wisdom, the Fool represents the start of the journey (or of a new journey, or a new cycle). The pack can be interpreted as spiritual baggage (or past karma) of which the Fool is not consciously aware. The jester’s hat stands in for motley (which does not show up very will in stick figures!). The Fool is sometimes drawn as a beggar—both of these occupations are ones where you own little and have no responsibilities. The Fool is the only Major Arcana card to survive to the modern playing-card deck."
  },
  "alleged-magician": {
    "name": "magician",
    "upright": "#alleged-magician-upright",
    "reversed": "#alleged-magician-reversed",
    "explain": "If the Fool represents blissful ignorance, the Magician (or Conjourer) represents skill and cleverness. In modern decks he is shown with an ‘infinity’ halo and the objects of the table before him are the four suits (representing mastery over the four elements). I have followed this tradition but given him both a pointy wizards’s hat (referring to the magical interpretation) and a rabbit and top hat (referring to the conjourer interpretation). The rabbit-from-the-hat trick also stands for showy skills that are not actually particularly useful—cleverness as opposed to wisdom. After all, the Magician is more skilled than the Fool, but has not advanced all that much through the journey of the Arcana."
  },
  "alleged-papess": {
    "name": "papess",
    "upright": "#alleged-papess-upright",
    "reversed": "#alleged-papess-reversed",
    "explain": "Old Italian tarot decks had a Pope and Papess (female Pope) rather than Hierophant and High Priestess, and I have followed suit. To mediaeval Italians, the Pope represented religious authority, and if representing the Pope in a deck of cards is cheeky, the Papess is downright subersive—a definite dig at the Establishment. This is consitent with the origin of the Tarot deck as a gambling or gaming deck. Nowadays we think of the Pope (Hierophant) as representing an advisor, not necessarily on spiritual and religious matters; the Papess can be read as standing for going outside regular channels, following one’s intuition, finding one’s own spiritual path. The High Priestess represents the same idea, but within the System rather than subverting it. This is a reflection of the idea that mystery and the hidden are an essential part of life, rather than an exception to the rule. In this aspect the card is also known as Juno (the most powerful of the Roman godesses, governing marriage, and identified with the Greek goddess Hera). The connection is with the Women’s Mysteries of the classical world. The Papess sits between two pillars I have labelled Alpha and Omega (sometimes Cabalistically called Boaz and Jachin after the two pillars in front of Solomon’s temple in the Bible). They are coloured black and white representing female and male principles, the same colours used in the Chinese Yin-Yang symbol. The Alpha and Omega suggest that everything (or all personalities) combines these masculine and feminine traits. Or perhaps the Omega is there to allude to a biological analogy between the white male pillar and phallus..."
  },
  "alleged-empress": {
    "name": "empress",
    "upright": "#alleged-empress-upright",
    "reversed": "#alleged-empress-reversed",
    "explain": "The Empress is here associated with Demeter or Ceres (goddess of fertility and the seasons). The bounty of nature is represented through civilized symbols: the grain and fruit she carries and the cow in the background represent cultivation and animal husbandry; the rolling hills are the result of agriculture rather than erosion. To a mediaeval person, surrounded by dangerous forests and barren mountains, a tilled field is more attractive than a natural wilderness: enjoying the scenery is a luxury reserved for people who are no longer threatened by it. Where the Papess represents female spirituality (which the ancients saw as mysterious and scary), the Empress stands for a feminine aspect of temporal authority—and in mediaeval times, women were in charge of food, hearth and home—and not much else. In magical tradition, the Empress is also the first authority figure in the body–mind–spirit ensemble. It is a little hard to see this in 2D, but my Empress’s crown has 12 red stones (five of them are on side of her head you can’t see) and four of those round stones in the pointy bits (one of them is hidden). Together with the Zodiac symbols on her dress, these symbolize the annual cycle of the seasons. Red flowers and the red in her dress traditionally represent menstrual blood; the waterfall and the blue in her dress are another symbol of fertility."
  },
  "alleged-emperor": {
