  "alleged-pope": {
    "name": "pope",
    "upright": "#alleged-pope-upright",
    "reversed": "#alleged-pope-reversed",
    "explain": "At the time the tarot decks were first devised (Italy around the 14th or 15th century), the Pope was a fact of life and a figure of religious and social authority—in those days religion defined society in a way we cannot really imagine today. This card stands for the institutions and authorities of society. It also symbolizes spiritual or religious teaching or advice, or, more loosely, professional advice in general (such as from your soliciter). In modern decks this card has been renamed The Hieriphant, a reference to a professional religious advisor in classical times. In magical tradition, the Pope is also the third authority figure in the body–mind–spirit ensemble. In my Alleged Tarot I have used the older names for some of the cards. The reason for this is that my original Pebble Tarot was based on the tarot deck I had at the time—the 1JJ Swiss tarot, and that uses the old card names. My Pope was the most popular card amongst my friends, and if I wanted to retain the Pope it followed I would be using the old names for the other cards too. You can tell he’s the Pope because he has a fancy hat and a kissable ring. He is also making the mystic hand signal which means ‘as above (in the spirit world), so below (in the material world)’. The Hierophant is often decorated with a pentacle; I have alluded to that in the five-pointed star on his Pope hat."
  },
  "alleged-lovers": {
    "name": "lovers",
    "upright": "#alleged-lovers-upright",
    "reversed": "#alleged-lovers-reversed",
    "explain": "In modern decks, this card shows a couple embracing. I have followed an older tradition showing suitor apparently choosing between two women. This card represents choice, the sort of choice where both alternatives are attractive and one must be abandoned forever. This reflects a reality of mediaeval life, which is that your choice of lover is significant (think doweries and family alliances) and irrevocable in a way it is not in modern times. To emphasize the choice aspect I show the two women standing on different branches of a forked path. The vaguely Victorian clothing is the result of my whimsical decision around the time I was drawing the Magician that the trumps would all be wearing hats of some sort. When it came to dressing a suitor, a top hat just seemed appropriate."
  },
  "alleged-chariot": {
    "name": "chariot",
    "upright": "#alleged-chariot-upright",
    "reversed": "#alleged-chariot-reversed",
    "explain": "The chariot card shows a chariot drawn by two horses (or fabulous beasts if you prefer a more magical look). The person in the chariot is often shown armoured and without reins—the beasts are controlled by the will. Like the pillars in the picture of the Papess, the beasts are coloured black and white to represent the mysterious female principle and the transparent male principle. The figure in the chariot represents our sense of self or will, which must guide the course of the chariot no matter how the much the two horses want to take over and gallop off in random directions. Apparently this illustration of the will versus our baser natures goes all the way back to Plato. It can also be interpreted in terms of Freud’s model (the superego controlling the id and ego, or however it is supposed to work). The helmet my charioteer is wearing is not from any particular historical period, although the chariot itself looks reasonably Roman or Greek. For no particular reason I have identified the chariot with Apollo’s (if the giant sun background is anything to go by). Since Apollo is god of reason and self-discipline, perhaps this is appropriate."
  },
  "alleged-justice": {
    "name": "justice",
    "upright": "#alleged-justice-upright",
    "reversed": "#alleged-justice-reversed",
    "explain": "You may have expected trump card number VIII to be Strength, because in the Rider–Waite these two cards were transposed to make the order better suit the zodiac signs attributed to the cards by the Golden Dawn. Their reordering of the trumps is not as arbitrary as it might sound at first; the oldest known tarot decks used unnumbered cards (the order of the trumps was either self-evident or irrelevant), and it is not too much of a stretch to claim that when the numbered decks were first printed, slight errors were made. On the other hand, my virtual deck tends whimsically to be modelled on the older decks, and so I have followed the older numbering. Justice and other abstract concepts have been depicted as women since Classical times because in Greek abstract nouns have the feminine gender. My depiction of Justice sans blindfold is also a self-conscious archaism: the blindfold is a relatively recent addition to the traditional props of the personification of Justice. I stood her on a roof-top because I was thinking of the famous statue of Justice standing atop the Old Bailey in London. This also allows my version of justice to search out wrong-doers and take a long view unobstructed by personal bias."
  },
