  "alleged-temperance": {
    "name": "temperance",
    "upright": "#alleged-temperance-upright",
    "reversed": "#alleged-temperance-reversed",
    "explain": "Temperance is one of the four Cardinal Virtues of Plato, together with Strength (Fortitude), Justice and Prudence (the last of which does not have a Tarot card). It means the combination of elements to make a stronger, more balanced whole—as in wine tempered with water (standard practice in Classical times), or phrases like justice tempered with mercy. So this card is about finding balance, and giving everything its measure. Abstract nouns are personified as women, a tradition that goes back to ancient Greece (since abstract nouns happen to have the feminine gender in that language). The wings are also traditional, even though Temperance is not intended to be seen as an angel in the Christian sense. The vessels she is holding are often coloured gold (suggesting the sun) and silver (suggesting the moon), an allusion to the idea that a healthy psyche is a mixture of feminine and masculine traits—or to the mystical theory that all reality is defined by feminine and masculine principles. I have alluded to the latter interpretation by incorporating a monad (yin-yang symbol) in to the face of my sketchy temple. It is further represented by the inclusion of children playing on a seesaw in the background."
  },
  "alleged-devil": {
    "name": "devil",
    "upright": "#alleged-devil-upright",
    "reversed": "#alleged-devil-reversed",
    "explain": "Naturally the trumps includes a card for the Devil—like the Pope and Death, for the mediaeval European, the Devil was a fact of life, and the recurring villain in any number of folk tales and hearthside stories. Nevertheless the depiction of devils makes some people nervous. In more modern decks, this card is sometimes replaced with a picture of the Horned Man, a pagan god of fertility and nature—even though the interpretation of the card remains broadly the same. The Devil card represents anger and resentment, and being trapped in a bad situation that you cannot escape (like the figures chained to the Devil’s plinth). In my version of the card I omitted the plinth, so the chains of the the two figures at the bottom of the card are held by the devil himself."
  },
