    "reversed": "#alleged-coins-1-reversed",
    "explain": "Coins stand for the financial and commercial side of life (that is, money). Coins also stands for the element of Earth, symbolizing physical feelings, practical skills, fertility and solidity. The Ace of Coins represents security, both finanical and in the sense of feeling secure and healthy. It also alludes to enjoying physical pleasures such as eating. My coin is decorated with a Diamond shape to remind us of its corresponding suit in modern playing cards."
