  "alleged-coins-13": {
    "name": "13 of coins",
    "upright": "#alleged-coins-13-upright",
    "reversed": "#alleged-coins-13-reversed",
    "explain": "The queen’s chair here is based on the Womb chair, model 70, designed by Eero Saarinen in 1947–48. I was looking for something broad in shape (suggesting the solidity of the element of earth), organic and enclosing in shape (though not as cup-like as the Queen of Cups’s Globe)."
  },
  "alleged-coins-14": {
    "name": "14 of coins",
    "upright": "#alleged-coins-14-upright",
    "reversed": "#alleged-coins-14-reversed",
    "explain": "The king’s chair is the Grand Confort, Model Nº LC2, designed in 1928 by LeCorbusier, Pierre Jenneret, and Charlotte Perriand. I chose it largely because of its shape—square, almost cubical, which suggests the element of earth."
  },
  "alleged-cups-1": {
    "name": "1 of cups",
    "upright": "#alleged-cups-1-upright",
    "reversed": "#alleged-cups-1-reversed",
    "explain": "Cups relate to the element of Water in an obvious way and are as feminine in shape in the same way swords and wands are phallic. The suit of Cups is largely associated with home life, domestic relations, love, sensitivity, and emotions, which I have alluded to by making my cup a tea cup with tea in it. Cups also represents artistic inspiration and the subconscious mind. The Ace of Cups often represents a warm, loving, empathetic person. The heart on the side also relates to this emotional sense, and also to the correspondence between Cups and the modern suit of Hearts."
  },
  "alleged-cups-2": {
    "name": "2 of cups",
    "upright": "#alleged-cups-2-upright",
    "reversed": "#alleged-cups-2-reversed",
    "explain": "The suit of Cups relates to life, domestic relations, love, and emotion. The Two of Cups thus represents a relationship between two people—this might be friendship, an affair or marriage. It does not have to be literally a love affair—it might relate to a business partnership or other collaboration, with trust and support on both sides. In drawing the Twos cards I used a single figure for Coins and Wands, female for Coins and male for Wands (their triaditional gender associations). For Cups and Swords I used two figures, because these suits are the the more archetypically feminine and masculine. Thus this card shows two women who are apparently embarking on a domestic arrangement of some sort—symbolized by looking at cups in a shop window."
  },
  "alleged-cups-3": {
    "name": "3 of cups",
    "upright": "#alleged-cups-3-upright",
    "reversed": "#alleged-cups-3-reversed",
    "explain": "The number 3 represents creativity and creation, and combined with the watery, emotional suit of cups, this means a birth, literal or figurative (as in emotional or creative growth). Three is a lucky number, and so this card also suggests a happy family life and good fourtune in matters of the heart. My glowing baby stick-figure is supposed to evoke Keith Haring’s glowing baby pictures."
  },
  "alleged-cups-4": {
    "name": "4 of cups",
    "upright": "#alleged-cups-4-upright",
    "reversed": "#alleged-cups-4-reversed",
    "explain": "The number 4 represents stability and solidity. Combined with the suit of cups (traditionally considered to be feminine and therefore traditionally considered passive), this leads to an overplus of stability, veering in to stagnation and boredom. All my Cups cards have a blue aspect (suggesting water), and in this one it dominates to give the whole picture a static look. At one point I considered adding props in the foreground to suggest carnal satiation but in the end a paper dart and some discarded magazines sufficed."
  },
