  "alleged-cups-13": {
    "name": "13 of cups",
    "upright": "#alleged-cups-13-upright",
    "reversed": "#alleged-cups-13-reversed",
    "explain": "The chair is the Ball (or Globe) chair, designed by Eero Aarnio around 1963–65. I chose it because of its shape—it is one of the most cup-like famous chair designs, so particularly appropriate to this, the most feminine of Cups cards (the Queens and the suit of Cups both being the associated with the feminine element of water)."
  },
  "alleged-cups-14": {
    "name": "14 of cups",
    "upright": "#alleged-cups-14-upright",
    "reversed": "#alleged-cups-14-reversed",
    "explain": "The chair I have give the King of Cups is (based on) the Egg chair, designed by Arne Jacobsen for the SAS Hotel in 1957–58. It seemed appropriate given its organic shape, which is cup-like but taller and less padded than the Globe (which I used for the Queen), which suits the King. The Egg chair was also used by Dr No in the James Bond film of the same name."
  },
  "alleged-swords-1": {
    "name": "1 of swords",
    "upright": "#alleged-swords-1-upright",
    "reversed": "#alleged-swords-1-reversed",
    "explain": "Nowadays the literally martial aspect of our lives is, happily, less important for many of us than it was in mediaeval times, so the meaning of the suit of Swords is interpreted more broadly. Swords straightforwardly represent strife, conflict and destruction. Justice and the courts were functions of the milita, so Swords represents justice and judicial proceedings. Warfare required strategy and analysis, so Swords also represents abstract thought and rationality, especially in a reductionist sense. The background reminds us that the suit of Swords is associated with the element of Air. I have shown the symbol of the modern suit of Spades engraved on the blade."
  },
  "alleged-swords-2": {
    "name": "2 of swords",
    "upright": "#alleged-swords-2-upright",
    "reversed": "#alleged-swords-2-reversed",
    "explain": "Swords represent military matters: strife, judicial matters, strategy and abstract thought. Twos represent combination of or balance between two forces. So the Two of Swords often represents opposing forces that have met in a (temporary) stalemate, truce, or impass. These can be internal states, like the knowledge that something must be done, versus reluctance to actually do it. It can also mean two forces or people in conflict that could work together given the right insight."
  },
