  "alleged-swords-13": {
    "name": "13 of swords",
    "upright": "#alleged-swords-13-upright",
    "reversed": "#alleged-swords-13-reversed",
    "explain": "The scales, water jug and photograph are supposed to symbolize the three zodiac signs associated with the suit of Swords (Libra, Aquarius, and Gemini). Why exactly Aquarius is an air sign is beyond me. The book represents knowlege and intellectual pursuits. Her crown is decorated with the symbol of the suit of spades, the modern equivalent of the tarot suit of swords. The chair is based on one designed by Otto Wagner for the ‘Die Zeit’ telegraph office, 1902."
  },
  "alleged-swords-14": {
    "name": "14 of swords",
    "upright": "#alleged-swords-14-upright",
    "reversed": "#alleged-swords-14-reversed",
    "explain": "The symbols in the background are of course those of the three zodiac signs associated with this suit. The King’s chair is a stick-figure version of the Aeron, designed by Donald Chadwick and William Stumpf in 1992. As well as having a name suggestive of air, the Aristotlian element associated the suit of Swords, the Aeron was one of the potent symbols of the information-technology boom of the late 1990s (and the sale of Aerons on E-bay was one of the potent symbols of the dot-com collapse in the early 2000s)—and the suit of Swords governs intellectual activity."
  },
  "alleged-wands-1": {
    "name": "1 of wands",
    "upright": "#alleged-wands-1-upright",
    "reversed": "#alleged-wands-1-reversed",
    "explain": "Wands stand for work in the sense of enthusiasm, creative labour and organization. This made sense to me when I thought of wands as suggesting various sorts of tool. The Ace of Wands often represents beginnings and new enterprises. The suit of Wands is also associated with the element of fire, which is why I have given this card a fiery background. The little sprig of leaves at the bottom of the wand serves two purposes: it symbolizes new beginnings (as this is an Ace), and it reminds us of the suit of Clubs in modern playing cards. (Older decks tend to draw the Wands as more literally club-like.)"
  },
  "alleged-wands-2": {
    "name": "2 of wands",
    "upright": "#alleged-wands-2-upright",
    "reversed": "#alleged-wands-2-reversed",
    "explain": "The Ace of Wands symbolizes the beginning of a new enterprise; the Two can mean you are thinking about how to take the next step—a time for assessing the progress so far and deciding which path to take to success. The suit often refers to one’s work or career, so the next ‘step’ might be a promotion, perhaps with an element of self-doubt as you consider whether you can cope with the new responsibilities. It can also symbolize other personal aims and ambitions. I have symbolized the decision as a fork in the road. The path behind the figure shows the progress made already. The early-morning sky shows that the journey has just started."
  },
  "alleged-wands-3": {
    "name": "3 of wands",
    "upright": "#alleged-wands-3-upright",
    "reversed": "#alleged-wands-3-reversed",
    "explain": "The number three symbolizes creation (think 2 parents plus one child), divinity (think of the Christian Trinity, Burton’s Triple Goddess, the Fates, the Norns) and luck. It also represents a progression beyond the ideas symbolized by the number two, especially in the suit of Wands, which often represents career progression, creative energy and your personal journey through life. The Three of Wands therefore can mean the successful start of a project (the sequel to the Two), or making plans for a grand project (the creativity sense of the number 3), and waiting to see how they turn out (with some optimisim, because 3 is lucky)."
  },
  "alleged-wands-4": {
    "name": "4 of wands",
    "upright": "#alleged-wands-4-upright",
    "reversed": "#alleged-wands-4-reversed",
    "explain": "The number 4 represents stability and completion—think of the four elements, the four corners of the earth, the four seasons. It thus stands for stability (as in ‘foursquare’). Combined with the creative intellectual energy of the suit of Wands, this gives a calm and creative environment where inspiration may be freely expressed. It may represent an actual place, or an event (like a holiday). Four wands standing in a square define a room, so I have illustrated this card with an artist’s studio. The fire-place shows it is cozy and comfortable—and links us to the element of fire (associated with this tarot suit). The fours usually indicate a an ORDERED environment; in a studio this order is often invisible to the casual observer, who sees the clutter of brushes, tubes of paint, and pictures piled around as chaotic, and does not understand the organization that the owner of the studio does."
  },
  "alleged-wands-5": {
    "name": "5 of wands",
    "upright": "#alleged-wands-5-upright",
    "reversed": "#alleged-wands-5-reversed",
    "explain": "After the stability of 4, the number 5 represents disruption and discord; to Discordians, it is Eris’s own number. The fives are generaly inauspicious cards in tarot, but when balanced against with the positive, creative energy of the suit of Wands, the 5 isn’t as bad as all that. It represents a problem or set-back, but nothing beyond what one’s resourcefulness cannot deal with. In fact, it may even be welcomed as break from the norm, or chance to demonstrate one’s mastery of the situation. I have illustrated this card with a cyclist repairing a puncture—thus while his journey is interrupted, the interruption is short-lived, because he as the tools he needs to repair the damage."
  },
