    "explain": "The chair is based on Charles Rennie Mackintosh’s chair design for the Argyle Street Tea Rooms, 1897. I chose it because its tall and narrow shape and oak construction suggests the suit of Wands to me. The shape of the headrest makes it slightly more ‘feminine’ in shape than the one I gave to the King. I have exaggerated its size to make it ore like a throne than a normal chair."
